import { useState } from "react";
import "./App.css";

function App() {
  const Table = () => {
    const [value, setValue] = useState(null);

    const handleClick = () => {
      setValue("X");
    };
    function Botton({ value, Click }) {
      return (
        <button className="st table" onClick={Click}>
          {value}
        </button>
      );
    }
  };

  const Click = () => {
    return (
      <>
        <div className="board-row">
          <Botton value={value} Click={() => handleClick()} />
          <Botton value={value} Click={() => handleClick()} />
          <Botton value={value} Click={() => handleClick()} />
        </div>
        <div className="board-row">
          <Botton value={value} Click={() => handleClick()} />
          <Botton value={value} Click={() => handleClick()} />
          <Botton value={value} Click={() => handleClick()} />
        </div>
        <div className="board-row">
          <Botton value={value} Click={() => handleClick()} />
          <Botton value={value} Click={() => handleClick()} />
          <Botton value={value} Click={() => handleClick()} />
        </div>
      </>
    );
  };

  return (
    <div className="App">
      <p>X/O Game</p>
      <Click />
    </div>
  );
}

export default App;
